import React from "react";
import ContentLoader from "react-content-loader";

function ReactContent(){
    return(
        <ContentLoader seed={1} width={400} height={160} backgroundColor="#666667" foregroundColor="#161E20">
            <rect x="0" y="0" rx="25" ry="25" width="360" height="72"/>
            <rect x="0" y="1" rx="25" ry="25" width="360" height="72"/>
            <rect x="0" y="0" rx="25" ry="25" width="360" height="72"/>
            <rect x="0" y="0" rx="25" ry="25" width="360" height="72"/>
            <rect x="0" y="0" rx="25" ry="25" width="360" height="72"/>
        </ContentLoader>
    );
}

export {ReactContent};
